#include <iostream>
#include <vector>
#include <algorithm>

using namespace std;

bool verify(vector<int> const &sorted, vector<int> const &original)
{
   vector<int> correctAnswer = original;
   sort(correctAnswer.begin(), correctAnswer.end());

   for (int i = 0; i < sorted.size(); ++i)
      if (sorted[i] != correctAnswer[i])
         return false;

   return true;
}

ostream &operator<<(ostream &os, vector<int> const &v)
{
   os << "[";
   for (int i = 0; i < v.size(); ++i)
   {
      os << v[i];
      if (i != v.size() - 1)
         os << ", ";
   }
   os << "]";

   return os;
}

// Merge the sorted subarrays specified by the ranges [start_a, end_a] and [start_b, end_b]
// Assumption: the subarrays are contiguous, i.e. if you iterate from start_a to end_b inclusive you will have traversed both subarrays
void merge(vector<int> &v, int start_a, int end_a, int start_b, int end_b)
{
   vector<int> scratch;

   int a = start_a, b = start_b;
   for (; a <= end_a && b <= end_b;)
   {
      if (v[a] <= v[b])
      {
         scratch.push_back(v[a]);
         a++;
      }
      else
      {
         scratch.push_back(v[b]);
         b++;
      }
   }
   {
      int start = 0, end = 0;
      if (a <= end_a)
      {
         start = a;
         end = end_a + 1;
      }
      else if (b <= end_b)
      {
         start = b;
         end = end_b + 1;
      }
      for (int i = start; i < end; ++i)
         scratch.push_back(v[i]);
   }

   for (int i = start_a; i <= end_b; ++i)
      v[i] = scratch[i - start_a];
}

void mergeSort(vector<int> &v, int start, int end)
{
   if (start >= end)
      return;

   int start_a = start;
   int end_a = start + (end - start) / 2;
   int start_b = end_a + 1;
   int end_b = end;
   mergeSort(v, start_a, end_a);
   mergeSort(v, start_b, end_b);
   merge(v, start_a, end_a, start_b, end_b);
}

void mergeSort(vector<int> &v)
{
   mergeSort(v, 0, v.size() - 1);
}

